import './Header.css'
import styled from "styled-components";
import '../../images/LogoBlack.png'

function Header() {
  return (
    <HeaderWrap>
        <LogoBlack/>
        <input></input>
        <img src=''></img>
    </HeaderWrap>
  );
}

const HeaderWrap = styled.div`
    display: flex;
    height: 50px;
    width: 100%;
    background-color: black;
    padding: 10px;
`;

const Logo = styled.img`
    
`

export default Header;
